  input: 'TEXT,F3XA,,"Regarding the FEC letter dated March 2, 2004 concerning the
    Alaska Democratic Party''s 2003 Year End Report:  The payment disclosed on Line
    15, Schedule A, from the Tony Knowles for US Senate campaign reflects payment
    for professional services rendered to the Tony Knowles for US Senate campaign
    by Casey Fenton, employed by the Alaska Democratic Party as Voter File Manager.  The
    Knowles for US Senate Campaign was billed by the Alaska Democratic Party at a
    rate of $18.75 per hour of Mr. Fenton''s time -- an amount equal to that which
    Mr. Fenton is paid as an employee of the Alaska Democratic Party.         Please
    note that no employee of the committee spent more than 25% of their time in any
    given month working on any Federal Election Activity or activities in connection
    with a Federal Election.  Therefore, salary payments for all employees are disclosed
    on Schedule B, Line 21B.   I hope this provides the information you require.   Should
    you have further questions, feel free to contact me via phone at 907-258-3050,
    via fax at 907-258-1626 or via regular mail at PO Box 231230, Anchorage, AK  99523-1230.  Sincerely,
    Joelle Hall, Treasurer"'
